  const tmp = useSelector((state) => state.reducer.isclose);
  return (
    // <div className="app" style={{ backgroundColor: "#E5E5E5", height: "100%" }}>
    <div className="app">
      {!ifclose ? (
        <ModelControl />
      ) : (
        <Product
          openCart={openCart}
          setopenCart={setopenCart}
          backMainPage={backMainPage}
        />
      )}
    </div>
  );
}

export default Body;
